import './App.css';
import { ChakraProvider,Box ,Container,Flex,CSSReset,GridItem,Grid} from '@chakra-ui/react'
import { } from '@chakra-ui/icons'
import Navbar from './components/navBar';
import SideBar from './components/leftSideBar';


function App() {
  return (
    <ChakraProvider>
      <CSSReset />
      <Flex direction="column" height="100vh">
        <Navbar />
        <Flex flex="1">
          {/* Adjust the Box styling as needed */}

            <Grid templateColumns="repeat(3, 1fr)" gap={4} h="100%" >
              <GridItem colSpan={1} borderLeftRadius='20'>
                Column 1
              </GridItem>
              <GridItem colSpan={1} h="full">
                Column 2
              </GridItem>
              <GridItem colSpan={1} h="full">
                Column 3
              </GridItem>
            </Grid>

        </Flex>
      </Flex>
    </ChakraProvider>
  );
}

export default App;
